It’s possible to add a field to the front or back of a card, but make it hidden until you explicitly show it. We call this a hint field . Before adding a hint, please bear in mind that the easier you make it to answer a question in Anki, the less likely you are to remember that question when you encounter it in real life. Please have a read about the "minimum information principle" on https://super-memory.com/articles/20rules.htm before proceeding. First, you’ll need to add a field to store the hint in if you have not already. Please see the fields section if you’re not sure how to do this. Assuming you’ve created a field called MyField, you can tell Anki to include it on the card but hide it by default by adding the following to your template: {{hint:MyField}} This will show a link labeled “show hint”; when you click it, the content of the field will be displayed on the card. (If MyField is empty, nothing will be shown.) If you show the hint on the question and then reveal the answer, the hint will be hidden again. If you want to have the hint always revealed when the answer is shown, you will need to remove {{FrontSide}} from your back template and manually add the fields you wish to appear. It is not currently possible to use a hint field for audio — the audio will play regardless of whether you’ve clicked on the hint link. If you want to customize the appearance or behaviour, you’ll need to implement the hint field yourself. We can not provide any support for doing so, but the following code should get you started: {{#Back}}
<a class=hint href="#"
onclick="this.style.display='none';document.getElementById('hint4753594160').style.display='inline-block';return false;">
Show Back</a><div id="hint4753594160" class=hint style="display: none">{{Back}}</div>
{{/Back}}

