You can watch a video about this feature on YouTube. The easiest way to check your answer is to click "Basic" at the top left of the card adding screen, and select "Basic (type in the answer)". If you have downloaded a shared deck and would like to type in the answer with it, you can modify its card template. If it has a template like: {{Native Word}} {{FrontSide}} <hr id=answer> {{Foreign Word}} To type in the foreign word and check if you are correct, you need to edit your front template so that it looks like this: {{Native Word}}
{{type:Foreign Word}} Here, we have added type: in front of the field we want to compare. Since FrontSide is on the back of the card, the type answer box will appear on the back as well. When reviewing, Anki will display a text box where you can type in the answer, and upon hitting Enter or showing the answer, Anki will show you which parts you got right and which parts you got wrong. The text box’s font size will be the size you configured for that field (via the “Fields” button when editing). Note that the type answer boxes don't appear in the preview dialog or in AnkiWeb. This feature does not change how the cards are answered, so it’s still up to you to decide how well you remembered or not. Only one typing comparison can be used on a card. If you add the above text multiple times, it will not work. It also only supports a single line, so it is not useful for comparing against a field that is comprised of multiple lines. Anki uses a monospaced font for the answer comparison so that the “provided” and “correct” sections line up. If you wish to override the font for the answer comparison, you can put the following at the bottom of your styling section: code#typeans { font-family: "myfontname"; } Which will affect the following HTML for the answer comparison: <code id=typeans>...</code> Advanced users can override the default type-answer colors with the css classes "typeGood", "typeBad" and "typeMissed". AnkiMobile supports "typeGood" and "typeBad", but not "typeMissed". If you wish to override the size of the typing box and don’t want to change the font in the Fields dialog, you can override the default inline style using !important, like so: #typeans { font-size: 50px !important; } It is also possible to type in the answer for cloze deletion cards. To do this, add {{type:cloze:Text}} to both the front and back template, so the back looks something like this: {{cloze:Text}}
{{type:cloze:Text}}
{{Extra}} If there are multiple sections elided, you can separate the answers in the text box with a comma.

