It is possible to include certain text, fields, or HTML on your cards only if a field is empty or not empty. An example: This text is always shown. {{#FieldName}} This text is only shown if FieldName has text in it
{{/FieldName}} {{^FieldName}} This text is only shown if FieldName is empty
{{/FieldName}} A real life example is only showing a label if the field is not empty: {{#Tags}} Tags: {{Tags}}
{{/Tags}} Or say you want to display a specific field in blue on the front of your card if there are extra notes on the back (perhaps the fact that there are notes serves as a reminder that you should spend more time thinking about the answer). You can style the field as follows: {{#Notes}} <span style="color:blue;">
{{/Notes}} {{FieldToFormat}} {{#Notes}} </span>
{{/Notes}} You can also use conditional replacement to control which cards are generated. This works since Anki will not generate cards which would have a blank front side. For example, consider a card with two fields on the front: {{Expression}}
{{Notes}} Normally a card would be generated if either the expression or notes field had text in it. If you only wanted a card generated if expression was not empty, then you could change the template to this: {{#Expression}} {{Expression}} {{Notes}}
{{/Expression}} And if you wanted to require both fields, you could use two conditional replacements: {{#Expression}} {{#Notes}} {{Expression}} {{Notes}} {{/Notes}}
{{/Expression}} Keep in mind that this only works when you place the conditional replacement code on the front of the card; if you do this on the back, you will simply end up with cards with a blank back side. Similarly, since this works by checking if the front field would be empty, it is important to make sure you wrap the "entire" front side in the conditional replacement; for instance, the following would not work as expected: {{#Expression}} {{Expression}}
{{/Expression}}
