Please see the cloze deletion section for background info. The cloze note type functions differently from regular note types. Instead of a customizable number of card types, it has a single type which is shared by all cloze deletions on a note. As mentioned in the card generation section above, generation of regular cards depends on one or more fields on the question being non-empty. Cloze deletion note types are generated differently: Anki looks on the front template for one or more cloze replacements, like {{cloze:FieldName}}. It then looks in the FieldName field for all cloze references, like {{c1::text}}. For each separate number, a card will be generated. Because card generation functions differently for cloze deletion cards, {{cloze:…​}} tags can not be used with a regular note type - they will only function properly when used with a cloze note type. Conditional generation provides a special field so you can check which card you are rendering. If you wanted to display the "hint1" field on the first cloze, and "hint2" field on the second cloze for example, you could use the following template: {{cloze:Text}} {{#c1}} {{Hint1}}
{{/c1}} {{#c2}} {{Hint2}}
{{/c2}}

