You can watch a video about styling cards on YouTube. The video shows Anki 2.0’s interface, but the concepts are largely the same. The styling section of the Cards screen can be accessed by clicking the "Styling" button next to the "Back Template" button. In that section, you can change the background color of the card, the default font, the text alignment, and so on. The standard options available to you are: font-family The name of the font to use on the card. If your font has spaces in it like "MS Unicode", then you need to surround the font name in double quotes, like font-family: "MS Unicode";. It is also possible to use multiple fonts on one card; for information on that, please see below. font-size The size of the font in pixels. When changing it, make sure you leave px at the end. text-align Whether the text should be aligned in the center, left, or right. color The color of the text. Simple color names like "blue", "lightyellow", and so on will work, or you can use HTML color codes to select arbitrary colors. Please see this webpage for more information. background-color The color of the card background. Any CSS can be placed in the styling section – advanced users may wish to do things like add a background image or gradient, for example. If you’re wondering how to get some particular formatting, please search the web for information about how to do it in CSS, as there is a great deal of documentation available. The styling is shared between all cards, which means that when you make an adjustment it will affect all cards for that note type. It is also possible to specify card-specific styling, however. The following example will use a yellow background on all cards except the first one: .card { background-color: yellow;
}
.card1 { background-color: blue;
}

