The default styling applies to the whole card. You can also make certain fields or part of the card use a different font, color, and so on. This is particularly important when studying foreign languages, as Anki will sometimes be unable to correctly display characters unless an appropriate font has been chosen. Say you have an “Expression” field, and you want to give it the macOS Thai font “Ayuthaya”. Imagine your template already reads: What is {{Expression}}? {{Notes}} What we need to do is wrap the text we want to style in some HTML. We will put the following in front of the text: <div class=mystyle1> And the following behind it: </div> By wrapping the text like the above, we tell Anki to style the wrapped text with a custom style called “mystyle1”, which we will create later. Thus if we wanted the entire “What is …​?” expression to use the Thai font, we would use: <div class=mystyle1>What is {{Expression}}?</div> {{Notes}} And if we wanted only the expression field itself to use the Thai font, we’d use: What is <div class=mystyle1>{{Expression}}</div>? {{Notes}} After we’ve edited the template, we now need to move to the Styling section between the templates. Before editing it, it should look something like: .card { font-family: arial; font-size: 20px; text-align: center; color: black; background-color: white;
} Add your new style to the bottom, so it looks like: .card { font-family: arial; font-size: 20px; text-align: center; color: black; background-color: white;
} .mystyle1 { font-family: ayuthaya;
} You can include any styling you want in the style. If you wanted to increase the font size too, you’d change the mystyle1 section to look like: .mystyle1 { font-family: ayuthaya; font-size: 30px;
} It’s also possible to bundle custom fonts with your deck, so you don’t need to install them on your computer or mobile device. Please see the installing fonts section for more info.

