You can have more control over Anki's scheduling of cards by using your own JavaScript in the custom scheduling field. This is a global option, so code entered here applies to every preset. Here is an example custom scheduling script. Note that, for Qt5 versions of Anki, the code needs to be transpiled. // print the existing states
console.log( JSON.stringify(states, null, 4)
); // load the debugger if the web inspector is open
debugger; // if the hard button is a learning step, make it
// a 123 minute delay
if (states.hard.normal?.learning) { states.hard.normal.learning.scheduledSecs = 123 * 60;
} // apply the same change in a rescheduling filtered deck
if (states.hard.filtered?.rescheduling?.originalState?.learning) { states.hard.filtered.rescheduling.originalState.learning.scheduledSecs = 123 * 60;
} // increase ease factor by 0.2 when Easy used on a review
if (states.good.normal?.review) { states.easy.normal.review.easeFactor = states.good.normal.review.easeFactor + 0.2;
} You can also see FSRS custom scheduling code as an example. The various scheduling states of cards are described in SchedulingStates .

