In order for Anki to create cards based on our notes, we need to give it a blueprint that says which fields should be displayed on the front or back of each card. This blueprint is called a card type . Each type of note can have one or more card types; when you add a note, Anki will create one card for each card type. All card types have two templates , one for the question and one for the answer. In the previous French example, we wanted the back of our recognition card to look like this: Q: Bonjour
A: Hello Page #12 To do this, we can set the answer template to: Q: {{French}}
A: {{English}}<br> Page #{{Page}} In card templates, field names are wrapped in double curly brackets, like {{French}} or {{English}}. Anki replaces those with the actual text the fields contain. This is called a "Field replacement" . Text not wrapped in double curly brackets appears the same on each card. For example, we won't need to add "Page #" on every note because the template will add it automatically to every card. The <br> tag is a special code that tells Anki to move to the next line. For details, see the templates section. The production card's templates will also work in a similar way: Q: {{English}}
A: {{French}}<br> Page #{{Page}} After a card type has been created, every time you add a new note, a card will be created based on that card type. Card types make it easy to keep the formatting of your cards consistent and can greatly reduce the amount of effort involved in adding information. They also mean Anki can ensure related cards don't appear too close to each other, and they allow you to fix a typing mistake or factual error once and have all the related cards update at once. To add and edit card types, click the Cards... button while adding or editing notes. For more information on card types, please see the Cards and Templates section.
